const Projects = () => (
  <div className="projects">
    <div className="projects--title">
      <h1>02. Projects</h1>
      <p>Here are some of my notable Projects</p>
    </div>
    <div className="projects--cards"></div>
    <style jsx>
      {`
        .projects {
          display: flex;
          text-align: center;
          flex-direction: column;
        }
      `}
    </style>
  </div>
);

export default Projects;
